  return (
  <>

   <Navc/>
   <Slider/>
    <Carde imgsrc="https://m.media-amazon.com/images/I/71jG+e7roXL._AC_UL480_QL65_.jpg" title="Apple Mac Book Pro" description="this is new apple product" path="/laptop"/>
    </>
